import React, {Component} from 'react';
import classes from './Portfolio.module.css';
import { Container, Row, Col } from 'react-bootstrap';
import portfolio_examples from '../../assets/images/portfolio_examples.png'

import CenterCard from './Cards/CenterCard/CenterCard';

class Portfolio extends Component {
  render(){
    return(
      <Container className={classes.PortfolioBody}>
        <div className={classes.Portfolio}>
          <h1>PORTFOLIO</h1>
        </div>
        <CenterCard image={portfolio_examples}></CenterCard>
      </Container>
    )
  }
}

export default Portfolio;
